pragma solidity ^0.8.0;

contract MyContract {
    uint256[] array4;

    function f() public {
        uint256[2] memory x = [uint256(1), 2];
        array4 = x;
        array4.push(100);
    }

    function getnum()
        public
        view
        returns (uint256[] memory, uint256[2] memory)
    {
        uint256[2] memory x = [uint256(1), 2];
        return (array4, x);
    }
}

